import React, {useEffect, useState} from 'react';


const SuperPageIcon = React.memo(function ({pageNum, onClick}) {

    return <button onClick={onClick}>{pageNum}</button>
});

const SuperPaginator = React.memo(function ({page, setPage, linesTotal, linesOnPage}) {

    const [pages, setPages] = useState(1);

    useEffect(()=>{
        // form paginator
        setPages(linesTotal / linesOnPage);
    }, [linesTotal, linesOnPage]);

    let onPageClick = (pageNum) => {
        setPage(pageNum)
    }


    // form jsx
    let pageIcons = [];
    for(let i = 0; i < pages; i++){
        pageIcons.push(<button key={i+1}>{i+1}</button>)
    }

    return <div className='paginator'>
        {pageIcons}
    </div>
});

export default SuperPaginator;
